import Vue from 'vue'
import VuRouter from 'vue-router'
import viewHome from '../views/Home/index.vue'
import viewUser from '../views/User/index.vue'
// import viewLogin from '../views/Login/index.vue'

Vue.use(VuRouter)

const routes =[
    {
        path:'/login',
        name:'Login',
        // component:viewLogin,
    },
    {
        path:'/home',
        name:'Home',
        component:viewHome,
        children:[
            {
                path:'/',
                name:'Login',
                component:viewHome,
            },
            {
                path:'/',
                name:'Login',
                component:viewHome,
            },
            {
                path:'/',
                name:'Login',
                component:viewHome,
            }
        ]
    },
    {
        path:'/user',
        name:'User',
        component:viewUser
    }
]

const router = new VuRouter({
    mode:'history',
    routes
})

export default router
